(("undefined"!=typeof self?self:this).webpackJsonp=("undefined"!=typeof self?self:this).webpackJsonp||[]).push([[13],{135:function(e,n){e.exports='\n                  <div class="markdown-body">\n                    <h1>Pri · <a href="https://www.npmjs.com/package/pri"><img src="https://img.shields.io/npm/v/pri.svg?style=flat-square" alt="npm version"></a></h1>\n<p>Pri is a toolkit for building <code>web applications</code> or <code>component</code> with React. <strong>Helps you deal with everything, and you can focus on business logic.</strong></p>\n<h2>Install</h2>\n<p>First, create an empty folder, and <code>npm i pri</code>:</p>\n<pre><code class="language-shell">mkdir test;\ncd test;\nnpm i pri --save;\n</code></pre>\n<p>Then, run <code>npx pri init</code>, and choose type: <code>Project</code> or <code>Component</code>.</p>\n<pre><code class="language-shell">npx pri init\n<span class="hljs-meta">\n#</span><span class="bash"> choose <span class="hljs-built_in">type</span>: Pri Plugin</span>\n? Choose project type (Use arrow keys)\n❯ Project\n  Component\n  Pri Plugin\n</code></pre>\n<blockquote>\n<p>No <code>npx</code>? Run <code>./node_modules/.bin/pri init</code>.</p>\n</blockquote>\n<h2>Project</h2>\n<p>Now you choose <code>Project</code>, you will create a web application.</p>\n<p>Then, run <code>npm start</code> to run this web application locally, and <code>npm run build</code> to create a bundle.</p>\n<p><strong>Deploy:</strong></p>\n<p>See deploy on the left menu. Or you can regist a command <code>npm run publish</code> by create a new pri-plugin.</p>\n<h2>Component</h2>\n<p>Now you choose <code>Component</code>, you will create a npm packages for any usage. Eg: an UI component, a Nodejs utils or a simple typescript definition package.</p>\n<p>Then, run <code>npm run docs</code> to debug your component, and <code>npm run build</code> to transfer your code from Typescript to ES3(not bundled).</p>\n<p><strong>Deploy:</strong></p>\n<p>Run <code>npm publish</code> to deploy your component.</p>\n<h2>Built-in packages in 2.x version</h2>\n<ul>\n<li><a href="https://www.npmjs.com/package/react">react@16.7.0</a></li>\n<li><a href="https://www.npmjs.com/package/react-dom">react-dom@16.7.0</a></li>\n<li><a href="https://www.npmjs.com/package/react-router-dom">react-router-dom@4.3.1</a></li>\n<li><a href="https://www.npmjs.com/package/antd">antd@3.13.0</a></li>\n<li><a href="https://www.npmjs.com/package/lodash">lodash@4.17.11</a></li>\n<li><a href="https://www.npmjs.com/package/react-loadable">react-loadable@5.5.0</a></li>\n<li><a href="https://www.npmjs.com/package/parcel-bundler">webpack@4.25.1</a></li>\n<li><a href="https://www.npmjs.com/package/babel-core">babel@7.2.2</a></li>\n<li><a href="https://github.com/Microsoft/TypeScript">typescript@3.2.2</a></li>\n<li><a href="https://github.com/facebook/jest">jest@23.6.0</a></li>\n</ul>\n\n                  </div>\n              '}}]);